const Div = ({ padding, dataResponse }) => {
  return (
    <div>
      <div>Tiempo: {dataResponse[num]?.weather}</div>
      {dataResponse[num]?.icon ? (
        <div>
          <img
            src={`http://openweathermap.org/img/wn/${dataResponse[num]?.icon}@2x.png`}
          />
        </div>
      ) : null}
      <div style={{ padding: padding }}>Temperatura: {dataResponse[num]?.temp}</div>
      <div style={{ padding: padding }}>
        Sensación Térmica: {dataResponse[num]?.feels_like}
      </div>
      <div style={{ padding: padding }}>
        Temperatura Mínima: {dataResponse[num]?.temp_min}
      </div>
      <div style={{ padding: padding }}>
        Temperatura Máxima: {dataResponse[num]?.temp_max}
      </div>
      <div style={{ padding: padding }}>Presión: {dataResponse[num]?.pressure}</div>
      <div style={{ padding: padding }}>Humedad: {dataResponse[num]?.humidity}</div>
      <div style={{ padding: padding }}>Visibilidad: {dataResponse[num]?.visibility}</div>
      <div style={{ padding: padding }}>
        Velocidad de viento: {dataResponse[num]?.windSpeed}
      </div>
      <div style={{ padding: padding }}>Amanecer: {dataResponse[num]?.sunrise}</div>
      <div style={{ padding: padding }}>Atardecer: {dataResponse[num]?.sunset}</div>
    </div>
  );
};

export default Div
